import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown, Figure, Tab, Row, Col,
  Sonnet, Placeholder, ProgressBar
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';
import ModalReact from './Modal/Modal';

function App() {

  const now = 100;
  return (
    <div className="App">
      <div className='progressBarBx'>
        <ProgressBar>
          <ProgressBar striped variant="success" now={35} key={1} />
          <ProgressBar variant="warning" now={20} key={2} />
          <ProgressBar striped variant="danger" now={10} key={3} />
        </ProgressBar>
        <ProgressBar striped animated variant="success" now={40} />
        <br />
        <ProgressBar animated variant="info" now={20} />
        <br />
        <ProgressBar variant="warning" now={60} />
        <br />
        <ProgressBar variant="danger" now={80} />
        <br />
      </div>
    </div>
  )
}

export default App;
